            <Route path="/scholarship" element={<Scholarship />} />
            <Route path="/experience" element={<Experience />} />
            <Route path="/projects" element={<Projects />} />
            <Route path="*" element={<p>Not found</p>} /> */}
          <Main />
      </HashRouter>
      <Footer />
    </div>
  );
}

export default App;
